A different kind of Tower Defense Game, you can build your own tower. Abula Tower Defense is set in the fantasy land of magic and collects the elements of fantasy, friendship, revenge, and self-improvement. It breaks the mode of achieving victory through simple formation deploying, a typical means adopted in traditional tower defense games. 

Heroes can purchase props from stores to equip themselves, which greatly upgrades the playability of the game. In the game, the heroes are to achieve the final victory against the enemies through careful deployment.

Features:

    Equipment system make game more interesting to play in a long time.
    5 scenes: Fire, Water, Air, Earth, Comprehensive, each with 8 levels and 2 hidden level. 
    50 Levels.
    8 towers: the local mercenary, the warrior, the fire mage, the water mage, the air mage, the earth mage, the catapult and the ballista(splash attack). The local mercenary, the warrior and catapult can only attack land forces, while the four mages and ballista can attack both land and air forces.
    Achievements System.

